import React from "react";
import ReactDOM from "react-dom";
import Cards from "./Cards";


class Todo extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            etxt : "hello state"
        }
    }
    render(){
        return (
        <h1>{this.state.etxt}</h1>
        )
    }
}

export default Todo;
